бодрить, подарить надежду! А еще могут из тысячи звонящих, узнать по голосу! Это правда. И это очень приятно. Спасибо вам всем огромное! Благодаря вам, атмосфера в фойе добрая и радушная, а еще спокойная, и вселяющая уверенность в то, что обязательно повезет, и все будет хорошо! Спасибо! ";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23504:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23504:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23504:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23504:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23504:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23742;a:24:{s:2:"ID";s:5:"23742";s:11:"ACTIVE_FROM";s:22:"19 декабря 2016";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:25:"Иванова Ирина";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23742:21";s:20:"PROPERTY_EMAIL_VALUE";s:21:"andreevim_lis@mail.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23742:22";s:25:"PROPERTY_SPECIALIST_VALUE";i:19;s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23742:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1724:"Здравствуйте! Хотим от всего сердца поблагодарить Ирину Львовну за наше маленькое чудо и огромное счастье стать родителями! Когда мы с мужем оказались в ситуации выбора места проведения лечения и врача (а выбор был действительно не легкий), то выбор пал на МЦРМ. И с первого же визита мы поняли,что не ошиблись! Знакомство с Ириной Львовной тоже оставило очень приятное впечатление-ничего лишнего, все четко. Каждый наш визит,это положительные эмоции и даже когда, что-то вроде бы не так...но Ирина Львовна всегда окажет моральную поддержку. И даже, когда у меня возникали вопросы,тревоги всегда можно было написать Ирине Львовне и она ответит. Благодаря грамотно подобранному лечению, через 9 месяцев мы стали родителями прекрасного мальчика. 
